"vs/platform/list/browser/listService":["Workbench",'Ist unter Windows und Linux der Taste "STRG" und unter macOSX der Befehlstaste zugeordnet.','Ist unter Windows und Linux der Taste "Alt" und unter macOSX der Wahltaste zugeordnet. ','Der Modifizierer zum Hinzufügen eines Elements in Bäumen und Listen zu einer Mehrfachauswahl mit der Maus (zum Beispiel im Explorer, in geöffneten Editoren und in der SCM-Ansicht). "ctrlCmd" wird unter Windows und Linux der Taste "STRG" und unter macOSX der Befehlstaste zugeordnet. Die Mausbewegung "Seitlich öffnen" wird – sofern unterstützt – so angepasst, dass kein Konflikt mit dem Modifizierer zur Mehrfachauswahl entsteht.',"Öffnet Elemente mit einem einzelnen Mausklick.","Öffnet Elemente mit einem doppelten Mausklick.",'Steuert, wie Elemente in Bäumen und Listen mithilfe der Maus geöffnet werden (sofern unterstützt). Legen Sie "singleClick" fest, um Elemente mit einem einzelnen Mausklick zu öffnen, und "doubleClick", damit sie nur mit einem doppelten Mausklick geöffnet werden. Bei übergeordneten Elementen, deren untergeordnete Elemente sich in Bäumen befinden, steuert diese Einstellung, ob ein Einfachklick oder ein Doppelklick das übergeordnete Elemente erweitert. Beachten Sie, dass einige Bäume und Listen diese Einstellung ggf. ignorieren, wenn sie nicht zutrifft.',"Steuert, ob Bäume horizontales Scrollen in der Workbench unterstützen."],
