"vs/workbench/parts/codeEditor/electron-browser/languageConfiguration/languageConfigurationExtensionPoint":["Fehler beim Analysieren von {0}: {1}","Das öffnende Klammerzeichen oder die Zeichenfolgensequenz.","Das schließende Klammerzeichen oder die Zeichenfolgensequenz.","Definiert die Kommentarsymbole.","Definiert, wie Blockkommentare markiert werden.","Die Zeichenfolge, mit der ein Blockkommentar beginnt.","Die Zeichenfolge, die einen Blockkommentar beendet.","Die Zeichenfolge, mit der ein Zeilenkommentar beginnt.","Definiert die Klammersymbole, die den Einzug vergrößern oder verkleinern.","Definiert die Klammerpaare. Wenn eine öffnende Klammer eingegeben wird, wird die schließende Klammer automatisch eingefügt.","Definiert eine Liste von Bereichen, in denen die automatischen Paare deaktiviert sind.","Definiert die Klammerpaare, in die eine ausgewählte Zeichenfolge eingeschlossen werden kann.","Die Worddefinition für die Sprache.","RegExp Muster für Wortübereinstimmungen.","RegExp Kennzeichen für Wortübereinstimmungen","Muss mit dem Muster `/^([gimuy]+)$/` übereinstimmen.","Die Einzugseinstellungen der Sprache.","Wenn eine Zeile diesem Muster entspricht, sollten alle Zeilen nach dieser Zeile einmal eingerückt werden (bis eine andere Regel übereinstimmt).","Das RegExp-Muster für increaseIndentPattern.","Die RegExp-Flags für increaseIndentPattern.","Muss mit dem Muster `/^([gimuy]+)$/` übereinstimmen.","Wenn eine Zeile diesem Muster entspricht, sollte der Einzug aller Zeilen nach dieser Zeile einmal aufgehoben werden (bis eine andere Regel übereinstimmt).","Das RegExp-Muster für decreaseIndentPattern.","Die RegExp-Flags für decreaseIndentPattern.","Muss mit dem Muster `/^([gimuy]+)$/` übereinstimmen.","Wenn eine Zeile diesem Muster entspricht, sollte **nur die nächste Zeile** nach dieser Zeile einmal eingerückt werden.","Das RegExp-Muster für indentNextLinePattern.","Die RegExp-Flags für indentNextLinePattern.","Muss mit dem Muster `/^([gimuy]+)$/` übereinstimmen.","Wenn eine Zeile diesem Muster entspricht, sollte ihr Einzug nicht geändert und die Zeile nicht mit den anderen Regeln ausgewertet werden.","Das RegExp-Muster für unIndentedLinePattern.","Die RegExp-Flags für unIndentedLinePattern.","Muss mit dem Muster `/^([gimuy]+)$/` übereinstimmen.","Die Faltungseinstellungen der Sprache.","Für eine Sprache gilt die Abseitsregel, wenn Blöcke in dieser Sprache durch die Einrücktiefe ausgedrückt werden. Wenn dies festgelegt ist, gehören leere Zeilen zum nächsten Block.",'Sprachspezifische Faltungsmarkierungen wie "#region" und "#endregion". Die regulären Anfangs- und Endausdrücke werden im Hinblick auf den Inhalt aller Zeilen getestet und müssen effizient erstellt werden.','Das RegExp-Muster für die Startmarkierung. Das Regexp muss mit "^" beginnen.','Das RegExp-Muster für die Endmarkierung. Das Regexp muss mit "^" beginnen.'],
