"vs/workbench/parts/files/electron-browser/files.contribution":["Explorer anzeigen","Explorer","Anzeigen","Textdatei-Editor","Binärdatei-Editor","Dateien","Konfigurieren Sie Globmuster zum Ausschließen von Dateien und Ordnern. Zum Beispiel entscheidet Explorer welche Dateien und Ordner gezeigt oder ausgeblendet werden anhand dieser Einstellung.",'Das Globmuster, mit dem Dateipfade verglichen werden sollen. Legen Sie diesen Wert auf "true" oder "false" fest, um das Muster zu aktivieren bzw. zu deaktivieren.','Zusätzliche Überprüfung der gleichgeordneten Elemente einer entsprechenden Datei. Verwenden Sie "$(basename)" als Variable für den entsprechenden Dateinamen.','Konfigurieren Sie Dateizuordnungen zu Sprachen (beispielsweise "*.extension": "html"). Diese besitzen Vorrang vor den Standardzuordnungen der installierten Sprachen.',"Die Standardzeichensatz-Codierung, die beim Lesen und Schreiben von Dateien verwendet werden soll. Diese Einstellung kann auch pro Sprache konfiguriert werden.","Wenn diese Option aktiviert ist, wird beim Öffnen von Dateien versucht, die Zeichensatzcodierung automatisch zu ermitteln. Diese Einstellung kann auch pro Sprache konfiguriert werden.","Das Zeilenende-Standardzeichen. Verwenden Sie \\n für LF und \\r\\n für CRLF.","Bei Aktivierung werden nachgestellte Leerzeichen beim Speichern einer Datei gekürzt.","Bei Aktivierung wird beim Speichern einer Datei eine abschließende neue Zeile am Dateiende eingefügt.","Wenn diese Option aktiviert ist, werden beim Speichern alle neuen Zeilen nach der abschließenden neuen Zeile am Dateiende gekürzt.","Eine geänderte Datei wird nie automatisch gespeichert.",'Eine geänderte Datei wird automatisch nach der konfigurierten "files.autoSaveDelay" gespeichert.',"Eine geänderte Datei wird automatisch gespeichert, wenn der Editor den Fokus verliert.","Eine geänderte Datei wird automatisch gespeichert, wenn das Fenster den Fokus verliert.",'Steuert die automatische Speicherung geänderter Dateien. Zulässige Werte: "{0}", "{1}", "{2}" (Editor verliert den Fokus), "{3}" (Fenster verliert den Fokus). Wenn diese Angabe auf "{4}" festgelegt ist, können Sie die Verzögerung in "files.autoSaveDelay" konfigurieren.','Steuert die Verzögerung in Millisekunden, nach der eine geänderte Datei automatisch gespeichert wird. Nur gültig, wenn "files.autoSave" auf "{0}" festgelegt ist.',"Konfigurieren Sie Globmuster von Dateipfaden, die von der Dateiüberwachung ausgeschlossen werden sollen. Muster müssen in absoluten Pfaden übereinstimmen (d. h. für eine korrekte Überstimmung muss das Präfix ** oder der vollständige Pfad verwendet werden). Das Ändern dieser Einstellung erfordert einen Neustart. Wenn Ihr Code beim Start viel CPU-Zeit beansprucht, können Sie große Ordner ausschließen, um die anfängliche Last zu verringern.","Hot Exit deaktivieren.",'Hot Exit wird beim Schließen der Anwendung ausgelöst, d. h. wenn unter Windows/Linux das letzte Fenster geschlossen wird oder wenn der Befehl "workbench.action.quit" ausgelöst wird (Befehlspalette, Tastenzuordnung, Menü). Alle Fenster mit Sicherungen werden beim nächsten Start wiederhergestellt.','Hot Exit wird beim Schließen der Anwendung, d. h. wenn unter Windows/Linux das letzte Fenster geschlossen wird, oder beim Auslösen des Befehls "workbench.action.quit" (Befehlspalette, Tastenzuordnung, Menü) sowie für jedes Fenster mit einem geöffneten Ordner ausgelöst, unabhängig davon, ob es das letzte Fenster ist. Alle Fenster ohne geöffnete Ordner werden beim nächsten Start wiederhergestellt. Legen Sie window.restoreWindows auf "all" fest, um Ordnerfenster im Zustand vor dem Herunterfahren wiederherzustellen. ',"Steuert, ob nicht gespeicherten Dateien zwischen den Sitzungen beibehlten werden, die Aufforderung zum Speichern wird beim Beenden des Editors übersprungen.","Verwenden Sie die neue experimentelle Dateiüberwachung.","Der Standardsprachmodus, der neuen Dateien zugewiesen wird.","Steuert den für VS Code verfügbaren Arbeitsspeicher nach einem Neustart beim Versuch, große Dateien zu öffnen. Gleiche Auswirkung wie beim Festlegen von --max-memory=NEWSIZE in der Befehlszeile.","Editor","Hiermit wird eine Datei beim Speichern formatiert. Es muss ein Formatierer vorhanden sein, die Datei darf nicht automatisch gespeichert werden, und der Editor darf nicht geschlossen werden.","Zeitüberschreitung beim Formatieren während des Speicherns. Legt eine Zeitbegrenzung in Millisekunden für formatOnSave-Befehle fest. Befehle, die länger dauern als die festgelegte Zeitüberschreitung, werden abgebrochen. ","Datei-Explorer",'Die Anzahl der Editoren, die im Bereich "Geöffnete Editoren" angezeigt werden.',"Steuert, ob der Explorer Dateien beim Öffnen automatisch anzeigen und auswählen soll.","Steuert, ob der Explorer das Verschieben von Dateien und Ordnern mithilfe von Drag  Drop zulassen soll.","Steuert, ob der Explorer um Bestätigung bittet, um Dateien und Ordner per Drag & Drop zu verschieben.","Steuert, ob der Explorer um Bestätigung bitten soll, wenn Sie eine Datei über den Papierkorb löschen.","Dateien und Ordner werden nach ihren Namen in alphabetischer Reihenfolge sortiert. Ordner werden vor Dateien angezeigt. ","Dateien und Ordner werden nach ihren Namen in alphabetischer Reihenfolge sortiert. Dateien und Ordner werden vermischt angezeigt.","Dateien und Ordner werden nach ihren Namen in alphabetischer Reihenfolge sortiert. Dateien werden vor Ordnern angezeigt.","Dateien und Ordner werden nach ihren Erweiterungen in alphabetischer Reihenfolge sortiert. Ordner werden vor Dateien angezeigt.","Dateien und Ordner werden nach dem letzten Änderungsdatum in absteigender Reihenfolge sortiert. Ordner werden vor Dateien angezeigt.",'Steuert die Sortierreihenfolge von Dateien und Ordnern im Explorer. Zusätzlich zur Standardsortierreihenfolge können Sie die Reihenfolge auf "mixed" (kombinierte Sortierung von Dateien und Ordnern), "type" (nach Dateityp), "modified" (nach letztem Änderungsdatum) oder "filesFirst" (Dateien vor Ordnern anzeigen) festlegen.',"Steuert, ob Dateidekorationen Farben verwenden.","Steuert, ob Dateidekorationen Badges verwenden."],
