"vs/workbench/parts/tasks/common/problemMatcher":["Die loop-Eigenschaft wird nur für Matcher für die letzte Zeile unterstützt.","Das Problemmuster ist ungültig. Die Eigenschaft darf nur im ersten Element angegeben werden.","Im Problemmuster fehlt ein regulärer Ausdruck.","Das Problemmuster ist ungültig. Es muss mindestens eine Datei und eine Nachricht aufweisen.",'Das Problemmuster ist ungültig. Es muss die Art "Datei" oder eine Zeile oder eine Speicherort-Übereinstimmungsgruppe aufweisen.',"Fehler: Die Zeichenfolge {0} ist kein gültiger regulärer Ausdruck.\n","Der reguläre Ausdruck zum Ermitteln eines Fehlers, einer Warnung oder von Informationen in der Ausgabe.","Ob das Muster einen Speicherort (Datei und Zeile) oder nur eine Datei enthält.","Der Übereinstimmungsgruppenindex des Dateinamens. Wenn keine Angabe erfolgt, wird 1 verwendet.","Der Übereinstimmungsgruppenindex der Position des Problems. Gültige Positionsmuster: (line), (line,column) und (startLine,startColumn,endLine,endColumn). Wenn keine Angabe erfolgt, wird (line,column) angenommen.","Der Übereinstimmungsgruppenindex der Zeile des Problems. Der Standardwert ist 2.","Der Übereinstimmungsgruppenindex des Zeilenzeichens des Problems. Der Standardwert ist 3.","Der Übereinstimmungsgruppenindex der Endzeile des Problems. Der Standardwert ist undefiniert.","Der Übereinstimmungsgruppenindex des Zeilenendezeichens des Problems. Der Standardwert ist undefiniert.","Der Übereinstimmungsgruppenindex des Schweregrads des Problems. Der Standardwert ist undefiniert.","Der Übereinstimmungsgruppenindex des Codes des Problems. Der Standardwert ist undefiniert.","Der Übereinstimmungsgruppenindex der Nachricht. Wenn keine Angabe erfolgt, ist der Standardwert 4, wenn die Position angegeben wird. Andernfalls ist der Standardwert 5.","Gibt in einer mehrzeiligen Abgleichschleife an, ob dieses Muster in einer Schleife ausgeführt wird, wenn es übereinstimmt. Kann nur für ein letztes Muster in einem mehrzeiligen Muster angegeben werden.","Der Name des Problemmusters.","Der Name des mehrzeiligen Problemmusters.","Die aktuellen Muster.","Trägt Problemmuster bei","Ungültiges Problemmuster. Das Muster wird ignoriert.","Ungültiges Problemmuster. Das Muster wird ignoriert.","Fehler: Die Beschreibung kann nicht in einen Problemabgleich konvertiert werden:\n{0}\n","Fehler: Die Beschreibung definiert kein gültiges Problemmuster:\n{0}\n","Fehler: Die Beschreibung definiert keinen Besitzer:\n{0}\n","Fehler: Die Beschreibung definiert keinen Dateispeicherort:\n{0}\n","Info: unbekannter Schweregrad {0}. Gültige Werte sind Fehler, Warnung und Info.\n","Fehler: Das Muster mit dem Bezeichner {0} ist nicht vorhanden.","Fehler: Die Mustereigenschaft verweist auf einen leeren Bezeichner.","Fehler: Die Mustereigenschaft {0} ist kein gültiger Name für eine Mustervariable.","Ein Problemmatcher muss ein Anfangsmuster und ein Endmuster für die Überwachung definieren.","Fehler: Die Zeichenfolge {0} ist kein gültiger regulärer Ausdruck.\n","Der reguläre Ausdruck zum Erkennen des Anfangs oder Endes eines Hintergrundtasks.","Der Übereinstimmungsgruppenindex des Dateinamens. Kann ausgelassen werden.","Der Name eines beigetragenen oder vordefinierten Musters","Ein Problemmuster oder der Name eines beigetragenen oder vordefinierten Problemmusters. Kann ausgelassen werden, wenn die Basis angegeben ist.","Der Name eines zu verwendenden Basisproblemabgleichers.",'Der Besitzer des Problems im Code. Kann ausgelassen werden, wenn "base" angegeben wird. Der Standardwert ist "external", wenn keine Angabe erfolgt und "base" nicht angegeben wird.','Eine visuell lesbare Zeichenfolge, die die Quelle dieser Diagnose beschreibt, z. B. "typescript" oder "super lint".',"Der Standardschweregrad für Erfassungsprobleme. Dieser wird verwendet, wenn das Muster keine Übereinstimmungsgruppe für den Schweregrad definiert.","Steuert, ob ein für ein Textdokument gemeldetes Problem nur auf geöffnete, geschlossene oder alle Dokumente angewendet wird.","Definiert, wie Dateinamen interpretiert werden sollen, die in einem Problemmuster gemeldet werden.","Muster zum Nachverfolgen des Beginns und Endes eines Abgleichers, der für eine Hintergrundaufgabe aktiv ist.",'Wenn dieser Wert auf "true" festgelegt wird, befindet sich die Hintergrundüberwachung im aktiven Modus, wenn die Aufgabe gestartet wird. Dies entspricht dem Ausgeben einer Zeile, die mit dem "beginPattern" übereinstimmt.',"Wenn eine Übereinstimmung mit der Ausgabe vorliegt, wird der Start einer Hintergrundaufgabe signalisiert.","Wenn eine Übereinstimmung mit der Ausgabe vorliegt, wird das Ende einer Hintergrundaufgabe signalisiert.","Die Überwachungseigenschaft ist veraltet. Verwenden Sie stattdessen den Hintergrund.","Muster zum Nachverfolgen des Beginns und Endes eines Problemabgleicher.",'Wenn dieser Wert auf "true" festgelegt wird, befindet sich die Überwachung im aktiven Modus, wenn der Task gestartet wird. Dies entspricht dem Ausgeben einer Zeile, die mit dem "beginPattern" übereinstimmt.',"Wenn eine Übereinstimmung mit der Ausgabe vorliegt, wird der Start eines Überwachungstasks signalisiert.","Wenn eine Übereinstimmung mit der Ausgabe vorliegt, wird das Ende eines Überwachungstasks signalisiert.","Diese Eigenschaft ist veraltet. Verwenden Sie stattdessen die Überwachungseigenschaft.","Ein regulärer Ausdruck, der signalisiert, dass die Ausführung eines überwachten Tasks (ausgelöst durch die Dateiüberwachung) beginnt.","Diese Eigenschaft ist veraltet. Verwenden Sie stattdessen die Überwachungseigenschaft.","Ein regulärer Ausdruck, der signalisiert, dass die Ausführung eines überwachten Tasks beendet wird.","Der Name des Problemabgleichers, anhand dessen auf ihn verwiesen wird.","Eine lesbare Bezeichnung für den Problemabgleicher.","Trägt Problemabgleicher bei","Microsoft-Compilerprobleme","LESS Probleme","Gulp-TSC-Probleme","JSHint-Probleme","JSHint-Stilprobleme","ESLint-Komprimierungsprobleme","ESLint-Stilprobleme","Go Probleme"],
