"vs/workbench/services/themes/common/fileIconThemeSchema":["Das Ordnersymbol für aufgeklappte Ordner. Das Symbol für aufgeklappte Ordner ist optional. Wenn diese Angabe nicht festgelegt wird, wird das für Ordner definierte Symbol angezeigt.","Das Ordnersymbol für zugeklappte Ordner. Gilt, wenn folderExpanded nicht festgelegt ist, auch für aufgeklappte Ordner.","Das Standarddateisymbol, das für alle Dateien angezeigt wird, die nicht mit einer Erweiterung, einem Dateinamen oder einer Sprach-ID übereinstimmen.","Ordnet Ordnernamen Symbolen zu. Der Objektschlüssel ist der Ordnername ohne jedes Pfadsegment. Muster oder Platzhalter sind unzulässig. Bei der Zuordnung von Ordnernamens wird nicht zwischen Groß-/Kleinschreibung unterschieden.","Die ID der Symboldefinition für die Zuordnung.","Ordnet Ordnernamen Symbolen für aufgeklappte Ordner zu. Der Objektschlüssel ist der Ordnername ohne jedes Pfadsegment. Muster oder Platzhalter sind unzulässig. Bei der Zuordnung von Ordnernamens wird nicht zwischen Groß-/Kleinschreibung unterschieden.","Die ID der Symboldefinition für die Zuordnung.","Ordnet Dateierweiterungen Symbolen zu. Der Objektschlüssel ist der Name der Dateierweiterung. Der Erweiterungsname ist das letzte Segment eines Dateinamen nach dem letzten Punkt (ohne den Punkt). Erweiterungen werden ohne Berücksichtigung von Groß-/Kleinschreibung verglichen.","Die ID der Symboldefinition für die Zuordnung.","Ordnet Dateinamen Symbolen zu. Der Objektschlüssel ist der vollständige Dateiname ohne Pfadsegmente. Der Dateiname kann Punkte und eine mögliche Dateierweiterung enthalten. Muster oder Platzhalter sind unzulässig. Bei der Dateinamenzuordnung wird nicht zwischen Groß-/Kleinschreibung unterschieden.","Die ID der Symboldefinition für die Zuordnung.","Ordnet Sprachen Symbolen zu. Der Objektschlüssel ist die Sprach-ID wie im Sprachbeitragspunkt definiert.","Die ID der Symboldefinition für die Zuordnung.","Schriftarten, die in den Symboldefinitionen verwendet werden.","Die ID der Schriftart.","Die Speicherorte der Schriftart.","Der Schriftartpfad relativ zur aktuellen Symboldesigndatei.","Das Format der Schriftart.","Die Gewichtung der Schriftart.","Der Stil der Schriftart.","Die Standardgröße der Schriftart.","Beschreibung aller Symbole, die beim Zuordnen von Dateien zu Symbolen verwendet werden können.","Eine Symboldefinition. Der Objektschlüssel ist die ID der Definition.","Bei Verwendung eines SVG- oder PNG-Datei: der Pfad zum Bild. Der Pfad ist relativ zur Symbolsammlungsdatei.","Bei Verwendung einer Glyphenschriftart: das zu verwendende Zeichen in der Schriftart.","Bei Verwendung einer Glyphenschriftart: die zu verwendende Farbe.","Wenn eine Schriftart verwendet wird: der Schriftgrad als Prozentsatz der Textschriftart. Wenn diese Angabe nicht festgelegt wird, wird standardmäßig die Größe in der Schriftartdefinition verwendet.","Bei Verwendung einer Schriftart: die ID der Schriftart. Wenn diese Angabe nicht festgelegt wird, wird standardmäßig die erste Schriftartdefinition verwendet.","Optionale Zuordnungen für Dateisymbole in hellen Farbdesigns.","Optionale Zuordnungen für Dateisymbole in Farbdesigns mit hohem Kontrast.","Konfiguriert, ob die Datei-Explorer Pfeile ausgeblendet werden sollen, wenn dieses Motiv aktiv ist."],
